int HashG(const char *key, const int *T)
{
    int sum = 0;

    for (int i = 0; key[i] != '\0'; i++)
    {
        sum += T[i] * key[i];
        sum %= 4631;
    }
    return kG[sum];
}

int PerfectHash(const char *key)
{
    if (strlen(key) > 35)
        return 0;

    return (HashG(key, kT1) + HashG(key, kT2)) % 4631;
}

